import React from 'react'
import { Layout, Menu } from 'antd'
import { Link } from 'react-router-dom'
function Sidebar(){
    return(

        <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
            <Link to='/'>
                <Menu.Item key="1">Home</Menu.Item>
            </Link>
      </Menu>
    )
}
export default Sidebar
